import React from 'react'

const parentDiv = {
    height: '100px',
    backgroundColor: 'lightblue',
    display: 'flex',
    justifyContent: 'space-around'
};

const logo = {
    backgroundColor: 'grey',
    fontSize: '25px',
    fontFamily: 'fantasy',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
    opacity: .5,

};

const otherPage = {
    backgroundColor: 'wheat',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
};

const links = {
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',   
    listStyleType: 'none',
    margin: 0,
    padding: 0,
};

const auth = {
    backgroundColor: 'yellow',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
};
const Navbar = () => {
  return (
    <nav style={parentDiv}>
        <div style={logo}>Shortly</div>
        <div style={otherPage}>
        <ul style={links}>
          <li>
            {/* <Link to="/">Home</Link> */} Home
          </li>
          <li>
            {/* <Link to="/blogs">Blogs</Link> */} Blogs
          </li>
          <li>
            {/* <Link to="/contact">Contact</Link> */} Contact
          </li>
        </ul>
        </div>
        <div style={auth}>Auth</div>
    </nav>
  )
}

export default Navbar;
